<script>
const canvasName = "canvas001"
const Framerate = 100/6
let entities = []

var debug = false

const resource = {}
const audio = {}

const blockUnit = 16

const itemLore = [
	
	{
		"name": "tofu",
		"disp":"大山とうふ",
		"lore": "きれいな水で作られたおいしいとうふ。+1000点！",

		}
	},
	
	{

		"disp": "大山こま",
		"lore": "伊勢原伝統のこま。一定時間敵にぶつからなくなる！",
		"store":"komastore",
		"func": (e) => {
			e.power = 1200

		}
	},
	
	{
		"name": "sake",

		"store":"tofustore",
		"func": (e) => {
			keyEnableLater()
		}
	}
	
	
]

const overlay = [
	{
		"name": "op", 
		"func":(e)=> {
			
			keyEnableLater()
			
		}

	},

	{
		"name":"map",

		"func":(e)=> {

			setTimeout(function() {

			}, 3000)

	}

]


var zoom = 2

var score = 0
var miss = 0
var time = 0

var player = null
var gravity = 0.009

var metric = 5

var dispW = 400
var dispH = 300

var rightPressed = false;
var leftPressed = false;
var upPressed = false;
var downPressed = false;
var upOld

var cameraX = 0
var cameraY = 0

var my = 0
var mx = 0
var cmy = null
var cmx = null

var run = false
var textarea = null
var focused = true

var worldSize = 0
var worldNum = 0

var enableKey = true

var progress = {"x":150, "y":150}

function x(px) {
	return px - (cameraX - dispW/(2*zoom))
}

function y(py) {
	return - py + cameraY + ( dispH/(2*zoom)) 
}

function rxy(e) {
	return [x(e.x)*zoom, y(e.y)*zoom, e.w*zoom, -e.h*zoom]
}

function centerText(c, str, x, y) {
	
	let w = c.measureText(str).width/2
	c.fillText(str, x - w, y)
	
}

function keyEnableLater() {
	
			setTimeout(function() {
				enableKey = true
			}, debug ? 100 : 1500)
	
}

class Entity {

	constructor(x, y, w, h) {

		this.sx = x
		this.sy = y

		this.x = x
		this.y = y
		this.w = w
		this.h = h
		this.vx = 0
		this.vy = 0

		this.grounded = false

		this.immortal = false
		
		this.platform = null
		
		this.flying = false


	}
	
	setspawn() {
			this.sx = this.x
			this.sy = this.y
	}

	respawn() {
		this.vx = 0
		this.vy = 0
		this.x = this.sx
		this.y =this. sy
	}

	phy() {
		
		let dvx = 0
		let dvy = 0
		
		if (!this.flying && this.grounded && (this.platform != null)) {
			dvx = this.platform.vx
			dvy = this.platform.vy
		}

		this.y += ((this.vy + dvy) * Framerate*0.1)
		
		if (this.x <= 0) {
			this.x = 1
			this.vx = 0
		} else {
			this.x += ((this.vx + dvx) * Framerate*0.1)
		}
		

		if (!this.flying)
			this.vy -= (gravity * Framerate) ;
		else
			this.vy *= 0.9
		
		if (this.grounded)
			this.vx *= 0.9
			
		if (this.y < -this.h) {
			this.fall()
		}

	}

	drawImage(c, srcKey) {
		this.drawImage(c, srcKey, false, false)
	}
	
	drawImage(c, srcKey, xFlip, yFlip) {
		
		let img = resource[srcKey]
		
		if (img == undefined)
			return

		c.save()
		
		let xa = x(this.x)
		let ya = y(this.y)

		c.transform(xFlip?-1:1, 0, 0, yFlip?-1:1, 0, 0);

		xa *= xFlip?-1:1
		xa -= xFlip ? this.w : 0
		
		ya *= yFlip?-1:1
		ya += yFlip ? this.h : 0

		let a = rxy(this)
		a[0] = xa*zoom
		a[1] = ya*zoom

		c.drawImage(img, 0 , 0, img.width, img.height, ...a);
		c.restore()

		
	}
	
	draw(c) {

		c.fillStyle = 'rgb(255, 0, 0)';
		c.fillRect(...rxy(this));

	}

	onCollide(e) {

		
		if ((e.onCollision(this) ?? false) || (e instanceof Gizmo))
			return
		
		let dx = ((e.x+(e.w/2)) - (this.x+(this.w/2)))
		let dy = ((e.y+(e.h/2)) - (this.y+(this.h/2)))

		if ( e.w / e.h > Math.abs( dx / dy ) ) { // collide from top or bottom

			if (dy<0) {

				this.grounded = true
				this.platform = e

				e.onTrample(this);
				
			} else if(e instanceof BrickBlock && this.vy > 0)  e.onHit(this);

			e.onCollideTop(this, dy)

		} else { // collide from side
			e.onCollideSide(this, dx)
			this.onCollideToSide(e)
		}

	}

	forceJump(v) {
		this.grounded = false
		this.vy = v
	}

	jump(velocity) {

		if (this.grounded && this.vy>=-Framerate*gravity) {
			this.forceJump(velocity)
			return true
		}
		return false
	}

	kill() {
		entities.splice(entities.indexOf(this), 1)
	}

	onCollideToSide(e) {}
	
	onCollideTop(e, dy) {
		e.y = this.y + ((dy<0) ? this.h : -(e.h+2))

			if (dy > 0 || e.vy < 0)
				e.vy = 0
	}
	
	onCollideSide(e, dx) {
			e.vx = 0;
			e.x = this.x + ((dx<0) ? this.w : -e.w);
	}

	onCollision(e) {}
	
	onTrample(e) {}

	fall() {
		if (this.immortal)
			this.respawn()
		else
			this.kill()
	}

}

class Animated extends Entity {
	
	constructor(x, y, w, h) {
		super(x, y, w, h)
		this.frame = 0
		this.timer = 0
		this.flip = false
		this.flipy = false
		this.flipx = false
		
		this.tmax = 5
		this.src = ""
	}
	
	draw(c) {
		
		this.flip = (this.vx > 0.1 ? false : this.flip)
		this.flip = (this.vx < -0.1 ? true : this.flip)

		let frame = this.getFrameImageName(this.grounded ? ( (this.vx**2)>0.1 ? this.frame : 1 ) : 0)

		this.drawImage(c, frame, this.flip ^ this.flipx, this.flipy)

		this.timer += 1
		if (this.timer >= this.tmax) {
			this.timer = 0
			this.frame += 1
			this.frame %=2

		}

	}
	
	getFrameImageName(frame) {
		return this.src + "_" + frame
	}
	
}

class Player extends Animated {

	constructor(x, y, w, h) {
		super(x, y, w, h)
		this.src = "kururin"
		this.immortal = true
		this.item = null
		this.powered = 0
		this.enableMove = true
		
		this.mapAnimCounter = 0
	}
	
	isPowered() {
		return this.power > 0
	}

	phy() {
		super.phy()
		
		if (this.grounded)
			this.enableMove = true
		
		if (this.isPowered()) {
			this.power --
			this.flipx = (this.power>>2) % 2 == 0
		} else {
			this.flipx = false
		}
	}
	
	score(scr) {
		score += scr
	}
	
	punchout(dir) {
		this.vx += (dir)
		super.jump(2)
		playSound("attack")
		this.enableMove = false
	}
	
	getItem(type) {
		
		this.item = type >= 0 ? itemLore[type] : overlay[-type-1]
		
		run = false
		enableKey = false
		
		let func = this.item["func"]
		
		if (func != null)
			func(this)
		
	}
	
	drawCard(c, img) {
		
		c.fillRect(0, 0, dispW, dispH)

		let w = dispW
		let h = dispH
		let x = 0
		let y = 0

		if (w/h >= img.width/img.height) {
			w = (img.width * dispH )/img.height
			x = (dispW-w)/2
		} else {
			h = (img.height * dispW )/img.width
			y = (dispH-h)/2
		}

		c.drawImage(img, 0 , 0, img.width, img.height, x, y, w, h);
		
		if (this.item["name"] == "map") {
			
			let xk = (w * progress["x"] * 0.01) + x
			let yk = (h * progress["y"] * 0.01) + y
			

			let img = resource[this.getFrameImageName((this.mapAnimCounter++>>4)%2)
			]

			if (img == undefined)
				return

			c.drawImage(img, 0 , 0, img.width, img.height, xk, yk, w/10, h/10);
			
		}
			
	}
	
	
	drawOverlay(c) {
		
		let img = resource[this.item["name"]]
		
		if (img == undefined)
			return
		

		let hl = dispH*0.2
		
		if (
			this.item["name"] == "op" || 
			this.item["name"] == "map" || 
			this.item["name"] == "end"
			 ) {
			
		c.fillStyle = 'orange'
			this.drawCard(c, img)
			
		} else {


			c.fillStyle = "rgba(0, 0, 0, 0.65)";
			c.fillRect(0, 0, dispW, dispH)

			c.drawImage(img, 0 , 0, img.width, img.height, (dispW/2)-50, (dispH/2)-50, 100, 100);

			c.fillStyle = 'white'
			centerText(c, this.item["disp"], (dispW/2), (dispH/2) - hl)
			centerText(c, this.item["lore"], (dispW/2), (dispH/2) + hl-10)

		}
		
			c.fillStyle = 'white'
		
		if (enableKey) {
			let msg = "とじる"
			if (player.item["name"] == "op") {
				c.fillStyle = 'black'
				msg = "はじめる"
			}
			
			centerText(c, "↑をおして" + msg , dispW/2, dispH-20)
		}
		
	}
	
	jump(vel) {
		if (super.jump(vel)) {
			playSound("pop")
		}
	}
	
	respawn() {
		super.respawn()
		playSound("miss")
	}
	
	onCollide(e) {
		
		if (!(e instanceof Enemy && this.isPowered())) {
			super.onCollide(e);
		}
		
		
	}
	
	
}

class Enemy extends Animated {


	constructor(x, y, size) {
		super(x, y, size*1.59375, size)
		this.src = "enemy"
		this.flipx = true
		
		this.t = false
		
		this.dir = -0.75
		this.cliff = false
		this.touch = false
		
		this.trampled = false
	}

	respawn() {
		super.respawn()
		this.dir = -0.75
	}

	phy() {
		super.phy()
		this.vx = this.dir
	}

	onCollision(e) {
		return this.flipy
	}
	
	onCollide(e) {
		
		if (e instanceof Player) {
			if (e.isPowered()) {
				//super.onCollide(e);
				return
			} else {
				e.punchout(this.dir * Math.abs(this.vx) * 2.5)
			}
		}

		if (!(e instanceof Gizmo) && !this.flipy && e instanceof Block) {
			this.t = false
			super.onCollide(e)
			if (this.x <= e.x || this.x+this.w >= e.x+e.w) {
				if (!this.cliff) {
					this.dir *= -1;
				}
				this.cliff = true
			} else 
				this.cliff = false
			
		} else 
			this.t = true
		

	}

	onCollideToSide(e, dx) {
		if (e instanceof Block && this.t) {
			if (!this.touch) {
				this.dir *= -1;
			}
			this.touch = true
		} else
			this.touch = false
	}
	
	death() {
		
		if (!this.flipy) {
			playSound("attack")
			this.flipy = true
			this.vy = 1
		}
		
	}
	
	onTrample(e) {
		if (!this.trampled && e instanceof Player) {
			this.trampled = true
			e.score(100)
		}
	}

}

class Boulder extends Animated {


	constructor(x, y, size) {
		super(x, y, size, size)
		this.src = "stone"
		this.flipx = true
		this.immortal = true
		
		this.t = false
		
		this.dir = -0.75
		this.cliff = false
		this.touch = false
		
		this.collideCount = 0
		
	}

	respawn() {
		super.respawn()
		this.dir = -0.75
	}

	phy() {
		super.phy()
		this.vx = this.dir
	}

	onCollision(e) {
		return this.flipy
	}
	
	onCollide(e) {
		
		if (e instanceof Player) {
			e.punchout(this.dir * Math.abs(this.vx) * 2.5)
		}


		if (!(e instanceof Gizmo) && !this.flipy && e instanceof Block) {
			super.onCollide(e)
		}



	}

	onCollideToSide(e, dx) {
		if (e instanceof Block) {
			if (!this.touch) {
				this.dir *= -1
				this.collideCount++
				if (this.collideCount >= 5) {
					this.respawn()
					this.collideCount = 0
				}
			this.touch = true
			} else
			this.touch = false
			
		}
		
	}
	
	death() {
		
		if (!this.flipy) {
			playSound("attack")
			this.flipy = true
			this.vy = 1
		}
		
	}
	
	onTrample(e) {
		if (e instanceof Player) {
			
			e.forceJump(2)
			
		}
	}

}

class Block extends Entity {

	constructor(a, b, c, d) {
		super(a, b, c*32, d*32)
	}
	
	
	phy() {}

	draw(c) {
		
		c.fillStyle = 'rgb(255, 0, 0)';
		c.fillRect(...rxy(this));

	}

}

class Ground extends Block {
	
	draw(c) {
		
		let height = this.h/32
		
		for(let yy=0; yy<height; yy++) {
			
			let img = resource[yy >= height-1 ? "grass" : "dirt"]
			
			if (img == undefined)
				continue
			
			for (let xx=0; xx<(this.w/32); xx++) {

				c.drawImage(img, 0 , 0, img.width, img.height, x(this.x+(xx * 32))*zoom, y(this.y+(yy * 32))*zoom, 32*zoom, -32*zoom);
				
			}
			
		}
	}
	
}

class Gizmo extends Block {}

class BgObject extends Gizmo {
	
	constructor(x, y, type) {
		super(x, y, 0, 0)
		
		this.name= type
		
	}
	
	draw(c) {
		
		let img = resource[this.name]
		
		if (img == undefined)
			return
		
		c.drawImage(img, 0 , 0, img.width, img.height, x(this.x)*zoom, y(this.y)*zoom, img.width * zoom, -img.height * zoom);
		
	}
	
}

class BrickBlock extends Block {

	onHit(e) {
		e.score(50)
		this.kill()
	}

	draw(c) {

		c.fillStyle = 'rgb(0, 100, 255)';
		c.fillRect(...rxy(this));

	}

}

class Flag extends Gizmo {

	constructor(x, y, w, h) {
		super(x, y, 1.5, 1.5)
		this.enabled = false
	}

	draw(c) {

		//c.fillStyle = this.enabled ? 'rgb(0, 255, 100)' : 'rgb(255, 100, 0)';
		
		this.drawImage(c, "flag")
		this.drawImage(c, this.enabled ? "flag_on" : "flag_off")

	}
	
	onCollideSide(e){}
	
	onCollision(e) {
		if (!this.enabled && e instanceof Player) {
			playSound("flag")
			e.setspawn()
			this.enabled = true
			e.score(500)
		}
	}

}

class GoalFlag extends Gizmo {

	constructor(x, y, n) {
		super(x, y, 2.5, 3.5)
		this.enabled = false
		this.world = n
	}

	draw(c) {

		this.drawImage(c, "goal")

	}
	
	onCollision(e) {
		if ( !this.enabled && e instanceof Player) {
			
			stopAllSound()
			playSound("clear")
			
			this.enabled = true
			
			if (!debug) {
			
				enableKey = false
				rightPressed = false;
				leftPressed = false;
				upPressed = false;
				downPressed = false;

				setTimeout(function() {

					worldNum = this.n ?? worldNum + 1
					
					if (worldNum >= worldSize) {
						stopAllSound()
						playSound("bgm_end")
						console.info("end")
						player.getItem(-3);
					} else {
						player = registryWorld()
						player.getItem(-2)
					}


				}, 4000)
				
			}


			}
	}

}

class Platform extends Block {
	
	constructor(a, b, c, d) {
		super(a, b, c, d)
	}
	
	onCollideTop(e, dy) {
		if ((this.y-this.h) <= e.y && dy < 0)
			super.onCollideTop(e, dy)
	}
	
	onCollideSide(e, dy) {}
	
	draw(c) {

		c.fillStyle = 'rgb(255, 50, 50)';
		c.fillRect(...rxy(this));

	}
	
}

class Lift extends Platform {
	
	constructor(x, y, w, mx, my) {
		super(x, y, w, 5/32)
		this.setspawn()
		this.mx = Math.abs(mx)
		this.my = Math.abs(my)
		this.dir = 0.3
	}
	
	phy() {
		
		let L = Math.sqrt(this.mx**2 + this.my**2)
		
		this.vx = this.dir * (this.mx / L)
		this.vy = this.dir * (this.my / L)
		
		this.y += (this.vy * Framerate*0.1)
		this.x += (this.vx * Framerate*0.1)
		
		let dx = this.x - this.sx 
		let dy = this.y - this.sy
		
		if (dx > this.mx || dx < 0 || dy >this.my || dy < 0)
			this.dir *= -1
		
	}
	
	draw(c) {
		this.drawImage(c, "lift")
	}
	
}

class Box extends Gizmo {
	
	open = false
	
	constructor(a, b, type) {
		super(a, b, 1.25, 1.5625)
		this.type = type
	}
	
	onCollision(e) {
		
		if ((!this.open) && e instanceof Player) {
			this.open = true
			playSound("open")
			
			let item = new Item(this.x+(this.w/2)-8 , this.y+this.h, this.type)
			entities.push(item)
			item.vy = 2.5
		}
		
	}
	
	
	draw(c) {

		this.drawImage(c, this.open ? "box_open" : "box_close", false, false)

	}
		
	
}

class Store extends Gizmo {
	
	open = false
	
	constructor(a, b, type) {
		super(a, b, 3, 3)
		this.type = type
	}
	
	onCollision(e) {
		
		if ((!this.open) && e instanceof Player) {
			this.open = true
			playSound("open")
			
			let item = new Item(this.x+(this.w/2)-8 , this.y+(this.h/2), this.type)
			entities.push(item)
			item.vy = 2.5
		}
		
	}
	
	
	draw(c) {

		this.drawImage(c, itemLore[this.type]["store"], false, false)

	}
	
}

class Item extends Entity {
	
	constructor(a, b, type) {
		super(a, b, 30, 30)
		
		this.type = type
		
		this.src = itemLore[type]["name"]
		
	}
	
	onCollide(e) {
		if (e instanceof Box)
			return
		else if (e instanceof Player && this.vy < 0.1) {
			e.getItem(this.type)
			this.kill()
			return
		} else
			super.onCollide(e)
	}
	
	onCollision(e) {
		return true
	}
	
	draw(c) {
		
		if (this.src == null)
			super.draw()
		else
			this.drawImage(c, this.src, false, false)

	}
	
}


const deserializer = {
	
	"Player": (a, b, c, d) => {return new Player(a, b, c, d)},
	"Enemy": (a, b, c) => {return new Enemy(a, b, c)},
	"Boulder": (a, b, c) => {return new Boulder(a, b, c)},
	"Block": (a, b, c, d) => {return new Ground(a, b, c, d)},
	"BrickBlock": (a, b, c, d) => {return new BrickBlock(a, b, c, d)},
	"Flag": (a, b) => {return new Flag(a, b)},
	"GoalFlag": (a, b, c) => {return new GoalFlag(a, b, c)},
	"Platform": (a, b, c, d) => {return new Platform(a, b, c, d)},
	"Lift": (a, b, c, d, e) => {return new Lift(a, b, c, d, e)},
	"Box": (a, b, c) => {return new Box(a, b, c)},
	"Gizmo": (a, b, c) => {return new BgObject(a, b, c)},
	"Store": (a, b, c) => {return new Store(a, b, c)},
	
	"map":(a, b) => {return {"x":a, "y":b}}
	
}

//現在のワールドをクッキーに保存
function saveToCookie() {

	let str = textarea.value.replaceAll("\n", "|")
	
	
	document.cookie = "edw="+str;
	
	
}

//クッキーに保存されたワールドを読み込む
function readCookie() {
	
	document.cookie.split(';').forEach((v)=>{
		let val = v.split('=');
		let name = val[0].trim()
		if (name=="edw") {
			let str = val[1].replaceAll("|", "\n")
			textarea.value = str;
		}
	})
	
}


function registryWorld(keep) {
	
	let p = keep ? player : null
	
	worlds = textarea.value.split("_split_")
	worldSize = worlds.length
	
	if (worldNum >= worldSize) {
		console.info("GAME END")
		return
	}
	
	entities = []
	
	list = worlds[worldNum].split("\n")
	
	for (let elem of list) {
		elem = elem.trim().split(":")
		let name = elem[0].trim()
		
		if (name in deserializer) {
			let args = []

			for(let raw of elem[1].split(",")) {
				let s = raw.trim()
				let n = parseInt(s, 10)
				args.push( isNaN(n) ? s : n)
			}
			
			let instance = deserializer[name](...args)
			
			if (instance instanceof Entity) {
			
				if (!keep && instance instanceof Player)
					p = instance
				else
					entities.push(instance)
				
			} else {
				
				progress = instance
				
			}
			
		}
	}

	
	run = true
	
	if (p == null)
		p = new Player(50, 50, 32, 32)
	
	entities.push(p)
	player = p
	
	if(debug)
		saveToCookie()
	
	return p

}

function playSound(name) {
	audio[name].play()
}

function stopAllSound() {
	for (let a in audio) {
		audio[a].pause()
		audio[a].currentTime = 0
	}
}

function start(src, sounds) {

	textarea = document.getElementById("world")
	
	textarea.style.display ="none"
	
	if (!debug) {
		
		var foo01 = document.querySelectorAll('*');


		foo01.forEach(function (elem) {
			elem.style.position = "fixed"
		});
		
	}
	
	if (debug)
		readCookie()

	const cv = document.getElementById(canvasName);

	if (!cv.getContext) return;

	registryWorld()
	
	player.getItem(-1) // opening window

	cameraX = player.x
	cameraY = player.y

	const ct = cv.getContext("2d");
	
	for (let key in src) {
		
		let len = src[key].length 
		
		for (let index =0; index < len; index++) {
			const image = new Image()
			let name = key+ (len > 1 ? ("_"+index) : "")
			image.src = "data:image/png;base64," + src[key][index]
			image.onload = () => {resource[name] = image}
		}
		
	}

	let queue = 0
	
	for (let key in sounds) {

		audio[key] = ""
		const uri = "data:audio/mp3;base64," + sounds[key][0]
		
		const sound = new Audio(uri)
		audio[key] = sound
		queue++

		sound.addEventListener('canplay', function(e) {
			queue --
		})
		
		if (key.indexOf("bgm") == 0) {
			sound.addEventListener("ended", function () {
				sound.currentTime = 0;
				sound.play();
			}, false);
			
			
		}

	}
	
	while(queue <= 0) {}
	

	cv.width = document.documentElement.clientWidth
	cv.height = document.documentElement.clientHeight - (debug ? 220 : 0)
	
	dispW = cv.width
	dispH = cv.height

	setInterval(() => {
		if (run && enableKey)
			time +=1
	}, 1000)
	
	setInterval(() => {


		textarea.style.display = debug ? "block" : "none"
		
		ct.clearRect(0, 0, cv.width, cv.height)
		ct.fillStyle = 'rgb(137,189, 222)';
		ct.fillRect(0,0, cv.width, cv.height);
		ct.fillStyle = 'rgb(0, 0, 0)';

		draw(ct)
		
	if (debug) {
		ct.fillStyle = 'rgb(0, 0, 0)'
		let str = "pos: " + mx + ", " + my + "  "
		if (cmx != null) 
			str += ", " + (mx-cmx) + ", " + (cmy-my)
		
		ct.fillText(str , 20, cv.height-20)
	}

	}, Framerate);

	document.addEventListener("keydown", kd, false);
	document.addEventListener("keyup", ku, false);
	cv.addEventListener("mousedown", mouseDown);
	cv.addEventListener("mousemove", mouseMove);
	cv.addEventListener("wheel", mouseWheel);

	// focus in event
	textarea.addEventListener("focus", () => {
		focused = false
	});

	// focus out event
	textarea.addEventListener("blur", () => {
		focused = true
	});
	
	
	
}

function kd(e) {
	
	if (!focused || !enableKey)
		return

	if (debug) {
		if (e.key === "f") {
			player.flying = ! player.flying
		} else if (e.key === "q") {
			registryWorld()
		} else if (e.key === "r") {
			registryWorld(true)
		} else if (e.key === "s") {
			run = !run
		}
	}
	
	if (player.item == null) {
		if (e.key === "Right" || e.key === "ArrowRight") {
			rightPressed = true
		} else if (e.key === "Left" || e.key === "ArrowLeft") {
			leftPressed = true
		}
	}
	
	if (e.key === "Up" || e.key === "ArrowUp") {
		
		if (player.item != null) {
			if (player.item["name"] == "op") {
				player.getItem(-2)
			} else{
				player.item = null
				run = true
			}
		} else {
			upPressed = true
		}
		
	} else if (e.key === "Down" || e.key === "ArrowDown") {
		downPressed = true
	}

}

function ku(e) {
	
	if (e.key === "Right" || e.key === "ArrowRight") {
		rightPressed = false
	} else if (e.key === "Left" || e.key === "ArrowLeft") {
		leftPressed = false
	} else if (e.key === "Up" || e.key === "ArrowUp") {
		upPressed = false
	} else if (e.key === "Down" || e.key === "ArrowDown") {
		downPressed = false
	}
}

function mouseMove(e) {
	
	const cv = document.getElementById(canvasName);
	
	mx = Math.round(   (e.clientX/zoom) - (cv.width/(2*zoom) )+ cameraX)
	my = Math.round( - ((e.clientY+window.scrollY)/zoom) + (cv.height/(2*zoom)) + cameraY )
	
}

function mouseDown(e) {
	
	cmx = mx
	cmy = my
}

function mouseWheel(e) {
	
  zoom += event.deltaY * -0.01;

  zoom = Math.min(Math.max(1, zoom), 2);
	
}

function draw(c) {

	cameraX -= (cameraX - player.x) * 0.05
	cameraY -= (cameraY - player.y) * 0.05

	let th = dispH /(2*zoom)
	let tw = dispW / (2*zoom)
		
	if (cameraY < th )
		cameraY = th

	if (cameraX < tw)
		cameraX = tw

	if (player.enableMove) {
		if ( rightPressed) {
			player.vx = 1
			//player.vx -= (player.vx - 1) * 0.05
		} else if (leftPressed) {
			player.vx = -1
			//player.vx -= (player.vx + 1) * 0.05
		}
	}
	
	if (!player.flying) {
		if (upPressed != upOld && upPressed)
			player.jump(4)
		upOld = upPressed
	} else {
		
		if (upPressed) {
			player.vy = 1
		} else if (downPressed) {
			player.vy = -1
		}

	}
	
	let bg = resource["bg"]
	
	let ccx = -((cameraX * 0.25 )% dispW)  //% dispW
	let ccy = (cameraY - th)* 0.25

	c.drawImage(bg, 0 , 0, bg.width, bg.height, ccx, ccy, dispW, dispH);
	c.drawImage(bg, 0 , 0, bg.width, bg.height, ccx+dispW, ccy, dispW, dispH);

	for (let e of entities)
		if (e instanceof Gizmo)
			e.draw(c)
	
	
	for (let e of entities)
		if (!(e instanceof Gizmo))
			e.draw(c)
	
	

	if (run)
	for (let e of entities) {

		if (!enableKey && !(e instanceof Player))
			continue
		
		e.phy()

		if (!(e instanceof Block )) {
			for (let ec of entities) {
				if (e != ec &&
						(e.x + e.w > ec.x           ) &&
						(e.x         < ec.x + ec.w  ) &&
						(e.y + e.h  > ec.y           ) &&
						(e.y         < ec.y + ec.h  )
					 ) {
					e.onCollide(ec);
				}
			}
		}
	}
	
	c.fillStyle = 'rgb(0, 0, 0)'
	c.font ="bold 30px serif"
	let str = "SCORE :  " + score + "    TIME : " + time
	c.fillText(str , 20, 25)
	
	if (player.item != null) {

		player.drawOverlay(c)

	}

}
